import styleCss from "./style.module.css";


function Landing() {
    return (
    <div>
        <img src="assets/background.png" className={styleCss.latar} alt="Logo" />
            
        <img src="assets/icon.png" className={styleCss.icon} alt="Logo" />
            
        <div className={styleCss.content}>
            <p className={styleCss.text}>
            Sign-up now and subscribe to enjoy all the cool<br/> and latest books - The best book rental service provider in Indonesia
            </p>
            
        </div>
    </div>
    )
}

export default Landing;
